import { useState } from 'react'

const Task = ({tasks}) => {
    return (
        <>
            {
                tasks.map(
                    (task) => (
                    <h3 key={task.id}>{task.id}. {task.text}</h3>
                    )
                )
            }
        </>
    )
}

export default Task
